The Ghana Health Service has reserved some of the Moderna vaccines and will use them for second doses in four weeks as the first dose  roll out in Greater Accra ends today. - @MzInterkudz 

#CovidVaccine #CovidVaccine 
@Aboagye_DG_GHS @gar_rhd 
@_GHSofficial

This is to prevent the initial situation with the AstraZeneca vaccines where the second doses were overly delayed because more shots did not arrive in time and the first batch was completely depleted. 

